    private void BgoActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_BgoActionPerformed
        SimpleDateFormat dateFormat = new SimpleDateFormat("dd/MM/yyyy");       //take the Date
        dt1 = dateFormat.format(date1.getDate());
        dt2 = dateFormat.format(date2.getDate());
        if (!ShortFunction.DateInBetween(Syear, dt1, Eyear) || !ShortFunction.DateInBetween(Syear, dt2, Eyear)) {
            JLabel label = new JLabel("Please Select Valid Dates");
            label.setFont(new Font("Arial", Font.BOLD, 18));
            JOptionPane.showMessageDialog(null, label, "ERROR", JOptionPane.WARNING_MESSAGE);
            date1.requestFocus();
            return;
        }
        itotalb = (float) 0.0;
        DefaultTableModel dm = (DefaultTableModel) table.getModel();             //To Clear all existing Data
        dm.getDataVector().removeAllElements();
        dm.fireTableDataChanged();

        ////TextIO.putln(dt);
//####################################################################################################################################
        // Item Stock Balance
        Scanner out;
        float netstck = (float) 00.0;
        String irate, Ename, Hname;
        double DAmt;
        float Dtotal = (float) 000.0;

        try {
            out = new Scanner(new File(ITMadd + "/item.txt"), "UTF-8");
            while (out.hasNext()) {
                String icode = out.nextLine();                                  //Read item Code
//####################################################################################################################################                        
                //Now read Rate
                Scanner ir = new Scanner(new File(ITMadd + "/" + icode + "/profile.txt"), "UTF-8");
                ir.nextLine();
                Ename = ir.nextLine();
                Hname = ir.nextLine();
                irate = ir.nextLine();
                ir.close();
//####################################################################################################################################                        
                // Now read the stock of this item

                netstck = (float) 0;
                File tmp;
                boolean dg;
                Scanner in;
                String tdt = ShortFunction.NamingDate(dt1);
                for (; ShortFunction.DateInBetween(tdt, tdt, dt2); tdt = ShortFunction.Date_plus(tdt)) {
                    tmp = new File(ITMadd + "/" + icode + "/Status/" + ShortFunction.NamingDateName(tdt) + ".txt");
                    System.out.println(ITMadd + "/" + icode + "/Status/" + ShortFunction.NamingDateName(tdt) + ".txt");
                    dg = tmp.exists();
                    if (dg) {
                        // ////TextIO.putln(ITMadd+"/"+icode+"/Status/"+ShortFunction.NamingDateName(tdt)+".txt");
                        in = new Scanner(tmp, "UTF-8");
                        in.useDelimiter(",|\\n");
                        in.nextLine();
                        in.nextLine();
                        while (in.hasNext()) {
                            String datee = in.next();
                            if (ShortFunction.DateInBetween(dt1, datee, dt2)) {
                                in.next();//Customer Code
                                String str = in.next();//Quantity
                                netstck += Float.valueOf(str);
                                if (Float.valueOf(str) > 0) {
                                    irate = in.next();
                                }
                            }
                            in.nextLine();
                        }

                    }
                }
                //////TextIO.putln("AMT :"+Amt);

                DAmt = (double) (netstck) * Float.valueOf(irate);
                DAmt = Double.valueOf(String.format("%.0f", DAmt));
                Dtotal += DAmt;
                DefaultTableModel model = (DefaultTableModel) table.getModel();
                String s1 = String.format("%.02f", netstck);
                String s3 = String.format("%.01f", DAmt);
                if (lang.compareToIgnoreCase("English") != 0) {
                    model.addRow(new Object[]{table.getRowCount() + 1, Hname, s1, irate, s3});
                } else {
                    model.addRow(new Object[]{table.getRowCount() + 1, Ename, s1, irate, s3});
                }

//####################################################################################################################################                        
            }

        } catch (FileNotFoundException ex) {
            JLabel label = new JLabel("Item item. !!! Error0015");
            label.setFont(new Font("Arial", Font.BOLD, 18));
            JOptionPane.showMessageDialog(null, label, "ERROR", JOptionPane.WARNING_MESSAGE);

        }
        total.setText(String.valueOf(Dtotal));
//####################################################################################################################################        

    }//GEN-LAST:event_BgoActionPerformed
