    private void BsetActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_BsetActionPerformed

        TableModel tm = table.getModel();
        tm.setValueAt(erate.getText(), erow, 3);
        tm.setValueAt(eamt.getText(), erow, 4);
        float tt = Float.valueOf(total.getText());
        tt = tt - pamt + Float.valueOf(eamt.getText());
        total.setText(String.valueOf(tt));
        //itotalb =itotalb-Float.valueOf(ists)*(prate-Float.valueOf(erate.getText()));
        erate.setText("0.0");
        eamt.setText("0.0");
        eqty.setText("0.0");
        ename.setText("");
        table.clearSelection();

    }//GEN-LAST:event_BsetActionPerformed

