    private void erateFocusLost(java.awt.event.FocusEvent evt) {//GEN-FIRST:event_erateFocusLost
        eamt.setText(String.valueOf(Float.valueOf(eqty.getText()) * Float.valueOf(erate.getText())));
    }//GEN-LAST:event_erateFocusLost

