    private void erateKeyPressed(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_erateKeyPressed
        int a = evt.getKeyCode();
        if (a == 10) {
            Bset.requestFocus();
        }
    }//GEN-LAST:event_erateKeyPressed

    private void BsetKeyPressed(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_BsetKeyPressed
        int a = evt.getKeyCode();
        if (a == 10) {
            Bset.doClick();
        }
    }//GEN-LAST:event_BsetKeyPressed

    private void tableKeyPressed(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_tableKeyPressed
        int row = table.getSelectedRow();//col=table.getSelectedColumn(); 
        System.out.println("Key Pressed1");
        if (row >= 0) {
            System.out.println("Key Pressed2");
            //int a = evt.getKeyCode();
            if (evt.getKeyCode() == KeyEvent.VK_E) {             //To edit Rate
                int roww;
                System.out.println("Key Pressed3");
                TableModel tm = table.getModel();
                Object o;
                //int trr = table.getRowCount();
                //________________________
                row = table.getSelectedRow();
                if (row >= 0) {
                    System.out.println("Key Pressed4");
                    ////TextIO.putln("Inside >0");
                    roww = table.getSelectedRow();
                    erow = roww;
                    o = tm.getValueAt(roww, 1);
                    //o= table.getValueAt(roww, 1);
                    final String iname = (String) o;
                    o = tm.getValueAt(roww, 2);
                    final String qty = (String) o;
                    o = tm.getValueAt(roww, 3);
                    String rate = (String) o;
                    o = tm.getValueAt(roww, 4);
                    String amt = (String) o;

                    // icode.setText((String)o);
                    prate = Float.valueOf(rate);
                    ename.setText(iname);
                    eqty.setText(qty);
                    erate.setText(rate);
                    pamt = Float.valueOf(amt);
                    eamt.setText(String.valueOf(amt));
                    ////TextIO.putln(iname+"\t"+qty+"\t"+rate);
                    erate.requestFocus();
                }

            } else {
                System.out.println("Key Pressed0");
                table.clearSelection();
            }

        }
    }//GEN-LAST:event_tableKeyPressed

